DELIMITER $$
--
-- Procedimentos
--
CREATE DEFINER=`root`@`localhost` PROCEDURE `Cadastrar_Carona_Completa` (IN `p_cnh` VARCHAR(20), IN `p_matricula` INT, IN `p_placa` CHAR(7), IN `p_modelo` VARCHAR(20), IN `p_cor` VARCHAR(15), IN `p_valor` DECIMAL(10,2), IN `p_forma_pagamento` VARCHAR(15), IN `p_data_agendamento` DATE, IN `p_cod_confirmacao` VARCHAR(4), IN `p_destino` VARCHAR(120), IN `p_origem` VARCHAR(120), IN `p_ponto_ref` VARCHAR(50), IN `p_hora_partida` TIME, IN `p_parada` VARCHAR(50))   BEGIN
    DECLARE v_cod_motorista INT DEFAULT NULL;
    DECLARE v_cod_transacao INT;
    DECLARE v_cod_carona INT;
    DECLARE v_cod_local INT;
    DECLARE v_aluno_existe INT DEFAULT 0;

    -- Verifica se aluno existe
    SELECT COUNT(*) INTO v_aluno_existe FROM ALUNO WHERE matricula = p_matricula;

    IF v_aluno_existe = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Aluno nao existe. Impossivel cadastrar motorista.';
    END IF;

    -- Continua se aluno existe
    SELECT cod_motorista INTO v_cod_motorista
    FROM MOTORISTA
    WHERE matricula = p_matricula
    LIMIT 1;

    IF v_cod_motorista IS NULL THEN
        INSERT INTO MOTORISTA (cnh, matricula) VALUES (p_cnh, p_matricula);
        SET v_cod_motorista = LAST_INSERT_ID();
    END IF;

    IF NOT EXISTS (SELECT 1 FROM VEICULO WHERE placa = p_placa) THEN
        INSERT INTO VEICULO (placa, modelo, cor, cod_motorista)
        VALUES (p_placa, p_modelo, p_cor, v_cod_motorista);
    END IF;

    INSERT INTO AJUDA_DE_CUSTO (valor, forma_de_pagamento)
    VALUES (p_valor, p_forma_pagamento);
    SET v_cod_transacao = LAST_INSERT_ID();

    INSERT INTO CARONA (cod_motorista, data_agendamento, cod_confirmacao, cod_transacao)
    VALUES (v_cod_motorista, p_data_agendamento, p_cod_confirmacao, v_cod_transacao);
    SET v_cod_carona = LAST_INSERT_ID();

    INSERT INTO LOCAL (ponto_referencia, destino, origem, hora_partida)
    VALUES (p_ponto_ref, p_destino, p_origem, p_hora_partida);
    SET v_cod_local = LAST_INSERT_ID();

    INSERT INTO LOCAL_CARONA (cod_carona, cod_local, parada)
    VALUES (v_cod_carona, v_cod_local, p_parada);
END$$

DELIMITER ;

